import React, { useEffect, useState } from "react";

function Resize1() {
  console.log("리사이즈");
  const [width, setWidth] = useState(null);

  useEffect(() => {
    window.addEventListener("resize", () => {
      setWidth(window.innerWidth);
    });
  }, []);

  return <div></div>;
}

export default Resize1;
